selector_to_html = {"a[href=\"#stacie.cutoff.CV2LCriterion.fcut_factor\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.fcut_factor\">\n<span class=\"sig-name descname\"><span class=\"pre\">fcut_factor</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#float\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">float</span></code></a></em></dt><dd><p>The scale factor to apply to the cutoff frequency.</p><p>If 1.0, the same part of the spectrum is used as in the full non-linear regression.\nBy using a larger value, the default, the criterion also tests whether\nthe fitted parameters can (somewhat) extrapolate to larger frequencies,\nwhich reduces the risk of underfitting.\nThis results in less bias on the autocorrelation integral, but slightly larger variance.</p></dd>", "a[href=\"#stacie.cutoff.CutoffCriterion\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CutoffCriterion\">\n<em class=\"property\"><span class=\"k\"><span class=\"pre\">class</span></span><span class=\"w\"> </span></em><span class=\"sig-name descname\"><span class=\"pre\">CutoffCriterion</span></span><a class=\"reference internal\" href=\"../_modules/stacie/cutoff.html#CutoffCriterion\"><span class=\"viewcode-link\"><span class=\"pre\">[source]</span></span></a></dt><dd><p>Bases: <a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#object\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">object</span></code></a></p><p>Base class for cutoff criteria.</p><p>Subclasses should implement the <code class=\"docutils literal notranslate\"><span class=\"pre\">__call__</span></code> method.</p></dd>", "a[href=\"#module-stacie.cutoff\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">stacie.cutoff module<a class=\"headerlink\" href=\"#module-stacie.cutoff\" title=\"Link to this heading\">\u00b6</a></h1><p>Criteria for selecting the part of the spectrum to fit to.</p>", "a[href=\"#stacie.cutoff.CV2LCriterion.precondition\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.precondition\">\n<span class=\"sig-name descname\"><span class=\"pre\">precondition</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#bool\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">bool</span></code></a></em></dt><dd><p>Whether to precondition the covariance eigendecomposition.</p><p>This option is only disabled for testing. Always leave it enabled in production.</p></dd>", "a[href=\"#stacie.cutoff.switch_func\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.switch_func\">\n<span class=\"sig-name descname\"><span class=\"pre\">switch_func</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">x</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">cutoff</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">exponent</span></span></em><span class=\"sig-paren\">)</span><a class=\"reference internal\" href=\"../_modules/stacie/cutoff.html#switch_func\"><span class=\"viewcode-link\"><span class=\"pre\">[source]</span></span></a></dt><dd><p>Evaluate the switching function at a given points x.</p></dd>", "a[href=\"#stacie.cutoff.CV2LCriterion\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion\">\n<em class=\"property\"><span class=\"k\"><span class=\"pre\">class</span></span><span class=\"w\"> </span></em><span class=\"sig-name descname\"><span class=\"pre\">CV2LCriterion</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"keyword-only-separator o\"><abbr title=\"Keyword-only parameters separator (PEP 3102)\"><span class=\"pre\">*</span></abbr></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">fcut_factor</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">1.25</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">log</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">False</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">cond</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">1000000.0</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">precondition</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">True</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">regularize</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">True</span></span></em><span class=\"sig-paren\">)</span><a class=\"reference internal\" href=\"../_modules/stacie/cutoff.html#CV2LCriterion\"><span class=\"viewcode-link\"><span class=\"pre\">[source]</span></span></a></dt><dd><p>Bases: <a class=\"reference internal\" href=\"#stacie.cutoff.CutoffCriterion\" title=\"stacie.cutoff.CutoffCriterion\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">CutoffCriterion</span></code></a></p><p>Criterion based on the difference between fits to two halves of the spectrum.</p></dd>", "a[href=\"#stacie.cutoff.CV2LCriterion.cond\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.cond\">\n<span class=\"sig-name descname\"><span class=\"pre\">cond</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#float\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">float</span></code></a></em></dt><dd><p>The threshold for the condition number of the preconditioned covariance matrix.</p><p>Due to the preconditioning, the condition number should be close to 1.0.\nIf not, the linear dependence of the parameters is too strong, making the fit unreliable.\nIn this case, \u201cinf\u201d is returned as the criterion.</p></dd>", "a[href=\"#stacie.cutoff.linear_weighted_regression\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.linear_weighted_regression\">\n<span class=\"sig-name descname\"><span class=\"pre\">linear_weighted_regression</span></span><span class=\"sig-paren\">(</span><em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">dm</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">ev</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">ws</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">lc</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">None</span></span></em>, <em class=\"sig-param\"><span class=\"n\"><span class=\"pre\">ridge</span></span><span class=\"o\"><span class=\"pre\">=</span></span><span class=\"default_value\"><span class=\"pre\">0.0</span></span></em><span class=\"sig-paren\">)</span><a class=\"reference internal\" href=\"../_modules/stacie/cutoff.html#linear_weighted_regression\"><span class=\"viewcode-link\"><span class=\"pre\">[source]</span></span></a></dt><dd><p>Perform a linear regression with multiple weight vectors.</p><p>This is a helper function for cv2l_criterion.</p></dd>", "a[href=\"#stacie.cutoff.CV2LCriterion.name\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.name\">\n<em class=\"property\"><span class=\"k\"><span class=\"pre\">property</span></span><span class=\"w\"> </span></em><span class=\"sig-name descname\"><span class=\"pre\">name</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/stdtypes.html#str\" title=\"(in Python v3.14)\"><span class=\"pre\">str</span></a></em></dt><dd><p>The name of the criterion.</p></dd>", "a[href=\"#stacie.cutoff.CV2LCriterion.log\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.log\">\n<span class=\"sig-name descname\"><span class=\"pre\">log</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#bool\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">bool</span></code></a></em></dt><dd><p>Whether to fit a linearized model to the logarithm of the spectrum.</p></dd>", "a[href=\"#stacie.cutoff.CutoffCriterion.name\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CutoffCriterion.name\">\n<em class=\"property\"><span class=\"k\"><span class=\"pre\">property</span></span><span class=\"w\"> </span></em><span class=\"sig-name descname\"><span class=\"pre\">name</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/stdtypes.html#str\" title=\"(in Python v3.14)\"><span class=\"pre\">str</span></a></em></dt><dd><p>The name of the criterion.</p></dd>", "a[href=\"#stacie.cutoff.CV2LCriterion.regularize\"]": "<dt class=\"sig sig-object py\" id=\"stacie.cutoff.CV2LCriterion.regularize\">\n<span class=\"sig-name descname\"><span class=\"pre\">regularize</span></span><em class=\"property\"><span class=\"p\"><span class=\"pre\">:</span></span><span class=\"w\"> </span><a class=\"reference external\" href=\"https://docs.python.org/3/library/functions.html#bool\" title=\"(in Python v3.14)\"><code class=\"xref py py-class docutils literal notranslate\"><span class=\"pre\">bool</span></code></a></em></dt><dd><p>Whether to regularize the linear regression.</p><p>This option is only disabled for testing. Always leave it enabled in production.\nIt will only have an impact on very ill-conditioned fits.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
